  input: '"TEXT","F3XA",,"e: Your letter dated April 3, 2002. ARMPAC includes a statement
    requesting the required donor information in every solicitation it does.  It also
    includes language informing donors that federal law requires ARMPAC to request
    such information from anyone who contributes more than $200 annually. If a contribution
    is received without it, a written request for the information is mailed within
    30 days, along with a pre-addressed return envelope.  Any contributor information
    received as a result of the PAC''s best efforts  is reported to the Commission
    either in an amended report or on the next report it files. With regard to the
    disbursements mentioned in your letter - the descriptions have been amended.  The
    H Schedules have been amended accordingly to include the proper percentages, year-to-date
    totals as well as disbursements and transfers.  And finally, the disbursement
    to Four Streams Golf was erroneously reported on line 21b instead of 21a.  That
    has been amended as well."'
